import React from "react";
import WeatherIcon from "./WeatherIcon";

export default function WeatherForecastDay(props){
    function maxTemperature(){
        let temperature = Math.round(props.data.max);
        return `${temperature}째`;
    }
    function minTemperature(){
        let temperature = Math.round(props.data.min);
        return `${temperature}째`;
    }

return (<div>
    <div className="weatherForecastDay">{props.data.dt}</div>
        <WeatherIcon code={props.data.weather[0].icon} size={40} />
        <div className="weatherForecastTemp">
            <span className="weatherForecastTemp-max">{maxTemperature()}</span>
            <span className="weatherForecastTemp-min">{minTemperature()}</span>
    </div>
</div>);
}
